import React, { useEffect, useState } from "react";
import { Row, Col, Container } from "react-bootstrap";

const StudentList = (classTitle) => {
  className = classTitle.classTitle;

  return (
    <>
      <Container>
        <Row>
          <Col>Student Lists</Col>
        </Row>
      </Container>
    </>
  );
};

export default StudentList;
